import styled from 'styled-components/native'

export const Container = styled.View`
  background: #FFF;
  height: 100%;
  width: 100%;
  align-items: center;
  padding: 60px;
`

export const Card = styled.View`

background-color: #fff;
border-style: solid;
border-width: 1px;
border-radius: 2px;
border-color: #DDD;
height: 200px;
width: 100%;
box-shadow: 0px 6px 5px rgba(0, 0, 0, 0.1);
margin-top: 30px;
display: flex;
text-align: center;
`

export const CardText = styled.Text`
  color: #222
  margin-top: 10px
  text-align: center;
  font-size: 24px;
`
